releases/0/tender/description:
Bromford Housing Group Limited, (Parent of the Group) as a central purchasing body on behalf of itself and any of its current or future entities and subsidiaries (together “Bromford”) wishes to invite interested companies (“Suppliers”) to participate in a procurement process to award a Contract for the reliable Supply of External Auditor and Associated Services.

Additional information: Bromford Housing Group Limited is a Registered Society incorporated under the Co-operative and Community Benefit Societies Act 2014 (no. 29996R) and whose registered office is at One Exchange Court, Brabourne Avenue, Wolverhampton Business Park, Wolverhampton WV10 6AU.

The current operating entities and subsidiaries of Bromford Housing Group Limited are:

Bromford Housing Association Limited, a Charitable Community Benefit Society incorporated under the Co-operative and Community Benefit Societies Act 2014 (FCA registered number: 7106);

Bromford Home Ownership Limited, a Registered Society under the Co-operative and Community Benefit Societies Act 2014 (FCA registered number: 29991R);

Bromford Assured Homes Limited, a Private Limited Company, incorporated under the Companies Act 2006 (registered number: 02677730);

Bromford Developments Limited, a Private Limited Company, incorporated under the Companies Act 2006 (registered number: 06507824);

Street Services Limited, a Private Limited Company, incorporated under the Companies Act 2006 (registered number: 03711394);

Riverside Mews Management Company Limited, a Private Limited Company, incorporated under the Companies Act 2006 (registered number: 02953846);

Strand Services (Whitchurch) Limited, a Private Limited Company, incorporated under the Companies Act 2006 (registered number: 02645753).

Bromford Housing Group Limited also has three dormant entities / subsidiaries as follows:-

Project Note Limited, a Private Limited Company, incorporated under the Companies Act 2006 (registered number: 03716147);

Bromford Carinthia Homes Limited, a Private Limited Company, incorporated under the Companies Act 2006 (registered number:02625632)

Queen Street Management Company (Lichfield) Limited, a Private Limited Company, incorporated under the Companies Act 2006 (registered number: 01764379).

The TFEIP supports Parties in the reporting of official air pollutant emissions and projections data to the Convention on Long-range Transboundary Air Pollution (CLRTAP). It also provides a technical forum and expert network to identify emission factors, establish methodologies for the estimation of emissions, and identify problems related to data reporting. The Authority funds specific roles within the TFEIP:
• Chair of the TFEIP;
• co-Chair of the TFEIP’s Projections Expert Panel (PEP);
• Secretariat Support for these roles.

 The Authority wishes to contract Aether Limited (the Contractor) to continue these activities.
